import "./App.css";
import React, {useState, useEffect} from "react";
import axios from "axios";
import Hotel from "./components/Hotel/Hotel";
import ItemHotel from "./components/Hotel/ItemHotel";
import Navbar from "./components/Hotel/Navbar";

const App = () => {
  const [hotel, setHotel] = useState([]);
  useEffect(() => {
    axios.get('https://hotels4.p.rapidapi.com/v2/get-meta-data')
        .then((res) => {
            console.log(res);
            setHotel(res.data);
        })
        .catch((err) => {
            console.log(err);
        })
  })
  return (
    <div>
      <Navbar></Navbar>
      <Hotel>
        <ul>
            {
                hotel.map(h => <li>{h.name}</li>)
            }
        </ul>
      </Hotel>
    </div>
  );
};

export default App;
